import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Register from "./pages/Register";
import Login from "./pages/Login";
import Catalog from "./components/Catalog"; // ← використовуємо компонент
import Header from "./components/Header"; // якщо хочеш спільну навігацію

function App() {
  return (
    <Router>
      <Header /> {/* Завжди показується */}
      <Routes>
        <Route path="/" element={<Catalog />} /> {/* Показує каталог на головній */}
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route path="/catalog" element={<Catalog />} />
      </Routes>
    </Router>
  );
}

export default App;
